⬇️ #AD - Loved exploring the food scene in Williamsburg! ⁠
⁠
😍 The spots I visited here are: ⁠
⁠
@pierces_pitt_bbq - the ribs and desserts omg!⁠
⁠
@berretsseafood - classic and well executed, love the desserts to share option.⁠
⁠
@culturecafeva - THE CHEESE CURDS!⁠
⁠
@cheeseshopva - Fresh, simple, delicious. ⁠
⁠
@bluetalonbistro - Love the french toast!⁠
⁠
@mobjackbaycoffee - History + coffee + food + treats! ⁠
⁠
@thehungrypugfoodtruck at @billsburgbrewery - Comfort food with a view that can’t be beat.⁠
⁠
The Williamsburg Lodge - Amazing location and part of the Marriott Autograph hotel collection.⁠
⁠
#VisitWilliamsburg #TravelVirginia @visitwilliamsburg⁠
