#AD ⬇️ Black-owned to check out in @charlottesgotalot ⬇️⁠
⁠
@UptownYolk for breakfast/brunch. I also love @Leah_and_Louise, which is from the same restaurant group and a great spot for dinner or date night! ⁠
⁠
@charlottefitnorth or @charlottefitsouth to get your sweat on!⁠
⁠
@jimmypearlsclt for perfectly cooked seafood!⁠
⁠
@Archive_CLT for excellent coffee, try some of their creative latte flavors! ⁠
⁠
@BirdPizzeria for the kind of pizza you can’t help but take a bite of before you get it home.⁠
⁠
@LoremIpsum.Bar for craft cocktails and good music in a really vibey chill spot. ⁠
⁠
@ThePaulineTeaBar for a spot to have a pot of tea and enjoy a relaxed atmosphere. ⁠
⁠
@WhatTheFriesCLT for excellent fresh-cut loaded fries. What The Fries is carryout/takeaway only though the community kitchen space they operate out of does have a few tables to sit and eat there if you’d like. ⁠
⁠
I also visited the @HBGanttCenter for African American Arts and Culture and loved the exhibits! ⁠
